import React, {useState} from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import {useInput} from "./useInput";


function App(){
  const [titleProps, resetTitle] = useState("");
  const [colorProps, resetColor] = useState("#000000");


  const submit = (e) => {
    //prevent page reload
    e.preventDefault();
    alert(`${titleProps.value} sound like ${colorProps.value}`);
    resetTitle("");
    resetColor("#000000");
  };
  return(
    <form onSubmit={submit}>
      <input 
        {...titleProps}
        type="text" 
        placeholder="Sound..." 
      />
      <input 
        {...colorProps}
        type="color" 
        onChange={(e) => setColor(e.target.value)}
      />
      <button>ADD</button>
    </form>
  )
}
ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
